    [],nt"num_tags": 23,nt"name": "environmental-assessment-of-alternatives-for-management-of-grasslands-on-the-anahuac-natio",nt"isopen":
    false,nt"url": null,nt"notes": "This environmental assessment is prepared
    to evaluate alternatives for managing grasslands to provide high quality habitat
    for wintering waterfowl, other migratory birds and other wildlife associated within
    the Anahuac National Wildlife Refuge Complex. The Fish and Wildlife Service proposes
    to initiate changes in the current management of grasslands on the Anahuac Complex
    to more effectively achieve refuge purposes and objectives. Five management alternatives
    have been developed and evaluated and a preferred alternative has been selected
    that will achieve the purposes and objectives of the Complex. The various management
    techniques, including their beneficial and detrimental effects are discussed.",nt"owner_org":
